// src/components/Dashboard.js
import React from "react";
import { useNavigate } from "react-router-dom";
import { FaHeartbeat, FaBone, FaBrain, FaPhone, FaHospital } from "react-icons/fa";
import { MdTipsAndUpdates } from "react-icons/md";

const Dashboard = () => {
  const navigate = useNavigate();

  const exerciseCards = [
    {
      title: "Cardiac Rehab",
      subtitle: "Cardiac Condition",
      description: "Step-Ups, Chair Marching, Leg Extensions",
      icon: <FaHeartbeat size={40} className="text-red-500" />,
      button: "Start",
      link: "/exercise/cardiac",
    },
    {
      title: "Orthopedic Rehab",
      subtitle: "Joint Recovery",
      description: "Chair Squats, Leg Raise, Shoulder Rolls",
      icon: <FaBone size={40} className="text-blue-600" />,
      button: "Start",
      link: "/exercise/ortho",
    },
    {
      title: "Neuro Rehab",
      subtitle: "Neurological Recovery",
      description: "Balance Training, Gait Training, Coordination",
      icon: <FaBrain size={40} className="text-purple-600" />,
      button: "Start",
      link: "/exercise/neuro",
    },
    {
      title: "Physiotherapy",
      subtitle: "Mobility Guidance",
      description: "Hydration, Proper Form, Rest",
      icon: <MdTipsAndUpdates size={40} className="text-green-600" />,
      button: "Start",
      link: "/exercise/physio",
    },
    {
      title: "Contact Us",
      subtitle: "We care about you",
      description: "Reach out to our rehab experts anytime.",
      icon: <FaPhone size={40} className="text-orange-500" />,
      button: "Know More",
      link: "/contact",
    },
    {
      title: "Best Rehab Center",
      subtitle: "Find Near You",
      description: "Discover top-rated rehab centers nearby.",
      icon: <FaHospital size={40} className="text-pink-500" />,
      button: "Find",
      link: "/centers",
    },
  ];

  return (
    <div className="min-h-screen bg-gray-100">
      <header className="bg-blue-800 text-white px-8 py-5 shadow-md rounded-b-xl">
        <h1 className="text-2xl font-semibold">AI Rehab Dashboard</h1>
      </header>

      <main className="p-6 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {exerciseCards.map((card, index) => (
          <div
            key={index}
            className="bg-white rounded-xl p-6 shadow hover:shadow-lg transition-transform transform hover:scale-105 text-center"
          >
            <div className="flex justify-center mb-4">{card.icon}</div>
            <h2 className="text-lg font-semibold text-gray-800">{card.title}</h2>
            <p className="text-sm text-gray-600 font-medium mt-1 mb-2">{card.subtitle}</p>
            <p className="text-sm text-gray-500 mb-4">{card.description}</p>
            <button
              onClick={() => navigate(card.link)}
              className="bg-blue-600 hover:bg-blue-700 text-white font-medium py-2 px-5 rounded-lg"
            >
              {card.button}
            </button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
